    const FROTA = Object.keys(DATA_VEICULOS).sort();

    // Utilit√°rio para converter string dd/mm/yyyy HH:MM:SS para Objeto Date JS
    function parseDateStr(str) {
        if(!str) return null;
        const [d, t] = str.split(' ');
        const [day, month, year] = d.split('/');
        return new Date(`${year}-${month}-${day}T${t}`);
    }

    // Utilit√°rio para formatar ISO yyyy-mm-dd para dd/mm/yyyy
    function formatDateBR(isoDate) {
        const [y, m, d] = isoDate.split('-');
        return `${d}/${m}/${y}`;
    }

    function getEmoji(dateObj) {
        const h = dateObj.getHours();
        if (h < 6) return "üåô";
        if (h < 12) return "‚òÄÔ∏è";
        if (h < 18) return "üå§Ô∏è";
        return "üåÜ";
    }

    function resetToday() {
        const today = new Date();
        const y = today.getFullYear();
        const m = String(today.getMonth() + 1).padStart(2, '0');
        const d = String(today.getDate()).padStart(2, '0');
        document.getElementById('datePicker').value = `${y}-${m}-${d}`;
        renderDashboard();
    }

    function switchTab(tab) {
        document.querySelectorAll('.tab-content').forEach(el => el.classList.remove('active'));
        document.querySelectorAll('.tab-btn').forEach(el => el.classList.remove('active'));
        document.getElementById('tab-'+tab).classList.add('active');
        document.getElementById(tab === 'inativos' ? 'btnInativos' : 'btnAtivos').classList.add('active');
    }

    function renderDashboard() {
        const inputDate = document.getElementById('datePicker').value; // yyyy-mm-dd
        const dateBR = formatDateBR(inputDate); // dd/mm/yyyy
        
        // Define o limite superior do tempo (Final do dia selecionado)
        const limitDate = new Date(inputDate + 'T23:59:59');

        let onlineCount = 0;
        let offlineCount = 0;

        const elInativos = document.getElementById('listaInativos');
        const elAtivos = document.getElementById('listaAtivos');
        elInativos.innerHTML = '';
        elAtivos.innerHTML = '';

        FROTA.forEach(prefixo => {
            const historico = DATA_COMMS[prefixo] || [];
            
            // 1. Filtrar hist√≥rico para ignorar o futuro (Snapshot)
            // Filtra comunica√ß√µes que aconteceram ANTES ou NO DIA selecionado
            const historicoPassado = historico.filter(c => {
                const d = parseDateStr(c.dataHora);
                return d <= limitDate;
            });

            // 2. Verifica se comunicou NO DIA EXATO selecionado
            const comunicouNoDia = historicoPassado.find(c => c.dataHora.startsWith(dateBR));

            if (comunicouNoDia) {
                // --- VE√çCULO ONLINE ---
                onlineCount++;
                const objDate = parseDateStr(comunicouNoDia.dataHora);
                const emoji = getEmoji(objDate);
                const hora = comunicouNoDia.dataHora.split(' ')[1];

                const card = document.createElement('div');
                card.className = 'card-veiculo';
                card.onclick = () => openModal(prefixo);
                card.innerHTML = `
                    <div class="card-head">
                        <span class="card-prefixo">${prefixo}</span>
                        <span class="badge bg-online">ONLINE</span>
                    </div>
                    <div class="card-time">${emoji} √öltima: ${hora}</div>
                `;
                elAtivos.appendChild(card);

            } else {
                // --- VE√çCULO OFFLINE ---
                offlineCount++;
                
                // Encontra a √∫ltima comunica√ß√£o v√°lida (dentro do limite de tempo)
                let lastText = "Sem dados anteriores";
                let emoji = "";

                if (historicoPassado.length > 0) {
                    // Como a lista vem ordenada do Python (mais recente primeiro), pegamos o indice 0
                    // do array filtrado 'historicoPassado'
                    const lastComm = historicoPassado[0];
                    lastText = lastComm.dataHora;
                    emoji = getEmoji(parseDateStr(lastText));
                } 
                // Se historicoPassado for vazio, significa que s√≥ tem dados FUTUROS (em rela√ß√£o a data selecionada)
                // ou n√£o tem dados nenhum.

                const tr = document.createElement('tr');
                tr.innerHTML = `
                    <td><span class="badge bg-offline">OFFLINE</span></td>
                    <td><strong>${prefixo}</strong></td>
                    <td>${emoji} ${lastText}</td>
                    <td><a class="link" onclick="openModal('${prefixo}')">Ver Hist√≥rico</a></td>
                `;
                elInativos.appendChild(tr);
            }
        });

        // Atualiza KPIs
        document.getElementById('countOnline').innerText = onlineCount;
        document.getElementById('countOffline').innerText = offlineCount;
        document.getElementById('countTotal').innerText = onlineCount + offlineCount;
        const rate = (onlineCount + offlineCount) > 0 ? (onlineCount / (onlineCount+offlineCount) * 100).toFixed(1) : 0;
        document.getElementById('ratePercent').innerText = rate + '%';

        document.getElementById('btnInativos').innerText = `Inativos (${offlineCount})`;
        document.getElementById('btnAtivos').innerText = `Ativos (${onlineCount})`;

        document.getElementById('msgInativos').style.display = offlineCount === 0 ? 'block' : 'none';
        document.getElementById('msgAtivos').style.display = onlineCount === 0 ? 'block' : 'none';
    }

    function openModal(prefixo) {
        document.getElementById('modal').style.display = 'block';
        document.getElementById('modalTitle').innerText = 'Ve√≠culo ' + prefixo;
        
        const info = DATA_VEICULOS[prefixo];
        const comms = DATA_COMMS[prefixo];

        document.getElementById('modalInfo').innerHTML = `
            <p><strong>S√©rie:</strong> ${info.serie} | <strong>Vers√£o:</strong> ${info.versao} | <strong>EOD:</strong> ${info.eod}</p>
        `;

        const elHist = document.getElementById('modalHistory');
        elHist.innerHTML = '';
        if(comms && comms.length > 0) {
            comms.forEach(c => {
                const d = document.createElement('div');
                d.className = 'history-item';
                d.innerText = c.dataHora + ' (' + c.tempoSegundos + 's)';
                elHist.appendChild(d);
            });
        } else {
            elHist.innerHTML = '<div class="no-data">Sem registros.</div>';
        }
    }

    function closeModal() {
        document.getElementById('modal').style.display = 'none';
    }

    window.onclick = function(e) {
        if(e.target == document.getElementById('modal')) closeModal();
    }

    // Init
    renderDashboard();

</script>
